import React from "react";
import {Navbar, Nav, NavLink} from 'react-bootstrap';
import './css/NavigationBar.css';
import Container from "react-bootstrap/Container";
import {Row} from "react-bootstrap";
import Col from "react-bootstrap/Col";

export default function NavigationBar() {

    return (
        <div>
            <Container fluid>
                <Row>
                    <Col className={"nav-bar"}>
                        <Navbar expand="lg" variant="light" bg="light" sticky={"top"}>
                            <Navbar.Brand href="/">Easy Recipes</Navbar.Brand>
                        </Navbar>
                    </Col>
                </Row>
                <Row>
                    <Col><NavLink href={"my-recipes"}>My Recipes</NavLink></Col>
                    <Col><NavLink href={"new"}>New Recipe</NavLink></Col>
                </Row>
            </Container>
        </div>
    );
}
